// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./Structs.sol";

/**
 * @title Positions handling for song staking
 * @author Eric Nordelo
 */
contract PositionsHandler is Ownable {
    StakePosition[] private _positions;

    constructor(StakePosition[] memory positions) {
        require(positions.length > 0, "Positions required");

        for (uint256 i; i < positions.length - 1; i++) {
            require(positions[i].requiredTRAX < positions[i + 1].requiredTRAX, "Invalid positions");
            _positions.push(positions[i]);
        }
        _positions.push(positions[positions.length - 1]);
    }

    function getPositions() external view returns (StakePosition[] memory positions) {
        return _positions;
    }

    function getPositionByIndex(uint256 _index) external view returns (StakePosition memory position) {
        if (_index == 0 || _index > _positions.length) {
            revert("Invalid index");
        }
        return _positions[_index - 1];
    }

    /**
     * @dev TODO add update positions functionality (only owner)
     */
}
